      <h1 className=" p-4 text-7xl sm:w-auto text-center font-sans ">Step to Wellness,</h1>
      <h1 className="text-9xl sm:w-auto  font-semibold text-center font-sans ">One <span className=' outline-1 bg-gradient-to-r  from-secondary to-primary bg-clip-text text-transparent'>Foot</span> at a Time.</h1>
      </div>
      <div className="z-0 bg-gray-300">
        <img classname="h-full object-cover" src={HeroImage} alt="Hero Image"/>
        
      </div>
    </div>      

);
};
